**Disclaimer: Do not attempt to exploit this vulnerability on a production system.**

The Dirty Pipe Linux vulnerability (CVE-2022-0847) involves mishandling of the pipe buffer when receiving a large write request and not copying what the function intends to copy. This can result in a corrupted hierarchical file system (HFS) directory record and an overflow of kernel memory. 

